import React from "react";
import "antd/dist/antd.css";
import Clock from "react-live-clock";
import { Switch } from "antd";
import moment from "moment";

const Time = () => {
  return (
    <div className="time">
      <Clock format={"HH:mm:ss"} ticking={true} timezone={"EST"} />
    </div>
  );
};

export default Time;
